Make your Home Screen look fabulous using a Widgetizer! Discover a unique custom widgets gallery for every taste, color and mood, grouped in 30 different categories and more.

Main Widgetizer App Features:
■ Custom Widgets Gallery – choose, edit and activate custom widgets you like from the biggest, colorful collection to add them to your Home Screen.
■ Widget Preview – see how the selected widget will look before activating and adding it to your Home Screen;
■ Widget Editor – edit custom widgets as you like. Customize Font, Color, Style, Display (Date, Time, Day, Battery).
■ Collage Widgets – create beautiful collage widgets from your Photos. Pick Color and Layout that suit your collage and widget size. Activate to add to your Home Screen;
■ Active Widgets – here are all your activated custom and collage widgets that you can add to your Home Screen;
■ Photo Widgets – make your own Photo and Photo Album widgets;

Widgetizer App Also Includes Content:
– 30 categories of custom widgets, such as: Animals, Landscapes, etc.
– 3000+ custom widgets with daily updates;
– 3 custom widgets in each category for free (90 custom widgets in each widget sizes for free in total);
– No ads!

How to add widgets to your Home Screen?
1. From the Home Screen, touch and hold a widget or an empty area until the apps jiggle.
2. Tap the “Add” button (+) in the upper-left corner.
3. Search for ”Widgetizer” or scroll down until you find the app.
4. Select a widget type, choose from three widget sizes, then tap ”Add Widget”.
5. Tap ”Done” and enjoy the widget!

How to edit widgets?
1. Touch and hold a widget to open the quick actions menu.
2. Tap ”Edit Widget”.
3. Make your changes, then tap outside of the widget to exit.

Unclear? Do not worry! You can find a more detailed guide with pictures inside the app by clicking on the (?) button.


Note: Free version of the app is limited to:
– 90 custom widgets in each widget sizes;
– 1 active custom and collage widget in each widget sizes;
– 3 collage widget layouts in each widget sizes.
To use the app without limits, an auto-renewable subscription ”Widgetizer Pro” is available.

Auto-renewable Subscription ”Widgetizer Pro” Includes:
